import React, { useState } from 'react';
//import { Route } from 'react-router';

const Login = () => {
    const [email, setEmail] = useState("");
    const [password, setPassword] = useState("");
    const [allEntry, setAllEntry] = useState([]);

    const SubmitForm = (e) => {
        e.preventDefault();
        if (password && email) {
            const newEntry = { id: new Date().getTime.toString(), email: email, password: password };
            setAllEntry([...allEntry, newEntry]);
            console.log(allEntry);
            setEmail("");
            setPassword("");
        }
        else {
            alert("please fillup");
        }
    }

    return (
        <>
            <div clasName="container-fluid nav_bg">
                <div className="row">
                    <div className="col-10 mx-auto">

                        <form action="" onSubmit={SubmitForm}>
                            <div className="mb-3">
                                <label htmlFor="emaillebel" className="form-label">Email address</label>
                                <input type="email" className="form-control" id="email" name="email" aria-describedby="emailHelp" onChange={(e) => setEmail(e.target.value)} />
                                <div id="emailHelp" className="form-text">We'll never share your email with anyone else.</div>
                            </div>
                            <div className="mb-3">
                                <label htmlFor="passlebel" className="form-label">Password</label>
                                <input type="password" className="form-control" id="password" name="password" onChange={(e) => setPassword(e.target.value)} />
                            </div>


                            <button type="submit" className="btn btn-primary">Submit</button>
                        </form>

                    </div>
                </div>
            </div>
        </>
    );
};

export default Login;
